description:
Den fallne angeln Sammael har gjort ansprak pa jorden i morkrets namn. Med hjalp av sin hotfulla och bevapnade insatsstyrka har han drankt den morka och odsliga staden i synd, vald och grymhet. Sammaels triumf ar total fram till dess att himlens siste arkeangel Gabriel anlander. Gabriel ar ung och stark och han ar den maktigaste krigare som skadats sedan hans foregangare Mikael forsvann. Nu hotar Gabriels mod och fardigheter att decimera Sammaels arme och befria Jade den forlorade angeln med ett hjarta av guld. Men Sammael har ett sista kort att spela ut: hemligheten om sitt eget forflutna, en kunskap som kan storta Gabriel for alltid.


Action fran 2007 av Shane Abbess med Andy Whitfield, Dwaine Stevenson, Samantha Noble m fl.

